import React from "react";

export default function Practice(props) {
  const [formData, setFormData] = React.useState({
    firstName: '',
    lastName: '',
    email: '',
    comments: ''
  });

  const handleChange = (event) => {
    setFormData(prev => ({
      ...prev, [event.target.name]: event.target.value
    }));
  }

  const { firstName, lastName } = formData;
  console.log('First Name is: ' + firstName);
  console.log('Last name is: ' + lastName);
  console.log('email is: ' + formData.email);
 
  return (
    <form>
        <input type="text" placeholder="First Name" id='firstName' name='firstName' onChange={ handleChange } value={ formData.firstName } style={{ paddingLeft: 7}}/>
        <br />
        <br />
        <input type="text" placeholder="Last Name" id='lastName' name='lastName' onChange={ handleChange } value={ formData.lastName} style={{ paddingLeft: 7}}/>
        <br />
        <br />
        <input type="email" placeholder="email" id='Email' name='email' onChange={ handleChange } value={ formData.email } style={{ paddingLeft: 7}}/>
        <br />
        <br />
        <textarea name='comments' placeholder="Comments" value={ formData.comments } onChange={ handleChange } style={{ paddingLeft: 7}}/>
    </form>
  );
}
